import React from 'react';
import { Carousel, Container, Row, Col } from 'react-bootstrap';
import item1 from '../pictures/photo.jpg';
import item2 from '../pictures/barber.jpg';
import item3 from '../pictures/beard trimming.jpg';
import logo from '../pictures/head.png';
import styled from 'styled-components';

const Styles = styled.div`
.carousel {

  -item {
    heigth: 100vh;
  }
}
.container {
  display: flex;
  position: relative;
  z-index: 2;
  padding: 2em 0;
  justify-content: space-around;
  
  p {
    font-size: 8vw;
    text-shadow: 0.05em 0.05em #000;
  }
  img {
    max-width: 50vw;
  }
}

.bg {
  z-index: 1;
  position: absolute;
  heigth: 100%
}

`

function Home() {
  return (
    <Styles id="home">
      <Carousel interval={false}>
        <Carousel.Item>
          <img
            className="d-block w-100 bg"
            src={item1}
            alt="Second slide"
          />
          <Container>
            <Row>
              <Col md={4} sm={12}>
                <p>Barber</p>
              </Col>
              <Col md={4} sm={12}>
                <img
                  className="d-block w-100"
                  src={logo}
                  alt="Second slide"
                />
              </Col>
              <Col md={4} sm={12}>
                <p>Andrew</p>
              </Col>
            </Row>
          </Container>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={item2}
            alt="Second slide"
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={item3}
            alt="Third slide"
          />
        </Carousel.Item>
      </Carousel>
    </Styles>

  )
}

export default Home;
